import React from 'react';
import './Slider.css';

const RangeSlider = ({ data }) => {
  const dataArray = Object.entries(data);
  const date = dataArray.find(([key, value]) => key === 'date')?.[1]; // Fetch the date value

  return (
    <div className="container">
      {dataArray.map(([key, value]) => (
        <div key={key}>
          {key === 'date' ? ( // Check if the key is 'date'
            <h6>{date}</h6> // Render the date value
          ) : (
            <>
              <label htmlFor="rangeSlider">{key}</label>
              <input type="range" className="form-control-range" id="rangeSlider" value={value} /><br />
            </>
          )}
        </div>
      ))}
    </div>
  );
};

export default RangeSlider;
